import 'package:b_dep/src/utils/variables.dart' as variables;

class BView extends StatefulWidget {
  BView({
    Key key,
    this.child,
  }) : super(key: key);

  Widget child;

  @override
  State<StatefulWidget> createState() => _BViewState();
}

class _BViewState extends State<BView> {
  int preColumnNum = 0;

  @override
  void initState() {
    super.initState();
  }

  @override
  void setState(fn) {
    if (mounted) {
      super.setState(fn);
    }
  }

  @override
  Widget build(BuildContext context) {
    return getWidget();
  }

  Widget getWidget() {
    if (kIsWeb) {
      variables.isUpdateSUtilsOnInit = false;
      return BreakpointBuilder(builder: (contextA, breakpoint) {
        if (breakpoint.columns <= 4) {
          ScreenUtil.init(
              BoxConstraints(
                  maxWidth: MediaQuery.of(context).size.width, maxHeight: MediaQuery.of(context).size.height),
              /*context: context,*/
              orientation: Orientation.portrait,
              designSize: variables.designSize ?? const Size(434.9, 774.8));
          return getWebMainWidget();
        } else {
          var h = MediaQuery.of(context).size.height;
          h = h > 150 ? h - 110 : h;
          SchedulerBinding.instance.addPostFrameCallback((timeStamp) {
            if (variables.blStateSetter != null) {
              variables.blStateSetter(() {});
            }
          });
          ScreenUtil.init(BoxConstraints(maxWidth: h * (9 / 16) + 4, maxHeight: h),
              /*context: context,*/
              orientation: Orientation.portrait, designSize: variables.designSize ?? const Size(434.9, 774.8));
          return Container(
            color: const Color(0xFF171717),
            child: Stack(
              children: [
                getBlupMark(),
                getJapText(),
                getRedCircle(),
                getMobileDecoration(),
              ],
            ),
          );
        }
      });
    } else {
      return widget.child;
    }
  }

  Widget getMobileDecoration() {
    return Container(
      margin: const EdgeInsets.all(40),
      child: Center(
        child: AspectRatio(
          aspectRatio: (9 / 16),
          child: Stack(
                children: [
                  Container(
                    width: double.maxFinite,
                    height: double.maxFinite,
                    decoration: BoxDecoration(
                        borderRadius: BorderRadius.circular(ScreenUtil().setWidth(40)),
                        gradient: const LinearGradient(
                          colors: [
                            Color(0xFF555555),
                            Color(0xFF2A2A2A),
                          ],
                          begin: Alignment.topCenter,
                          end: Alignment.bottomCenter,
                        ),
                        boxShadow: const [
                          BoxShadow(
                            color: Color(0xFF8D8D8D),
                            blurRadius: 0,
                            spreadRadius: 0,
                            offset: Offset(0, -1),
                          )
                        ]),
                  ),
                  Container(
                    margin: const EdgeInsets.only(
                      top: 15,
                      bottom: 15,
                      left: 7,
                      right: 7,
                    ),
                    child: ClipRRect(
                        borderRadius: BorderRadius.circular(ScreenUtil().setWidth(35)),
                        child: getWebMainWidget()),
                  ),
                ],
          ),
        ),
      ),
    );
  }

  Widget getRedCircle() {
    return Center(
      child: Padding(
        padding: EdgeInsets.only(bottom: ScreenUtil().setHeight(120)),
        child: Container(
          width: ScreenUtil().setWidth(570),
          height: ScreenUtil().setWidth(570),
          decoration: BoxDecoration(
              color: const Color(0xFFD90000),
              borderRadius: BorderRadius.circular(ScreenUtil().setWidth(550)),
              boxShadow: [
                BoxShadow(
                  color: const Color(0x90D90000),
                  blurRadius: 30,
                  spreadRadius: 0,
                  offset: Offset(0, ScreenUtil().setWidth(110)),
                )
              ]),
        ),
      ),
    );
  }

