    return Align(
      alignment: Alignment.bottomRight,
      child: Padding(
        padding: const EdgeInsets.only(right: 30, bottom: 20),
        child: Material(
          color: Colors.transparent,
          child: Row(
            mainAxisSize: MainAxisSize.min,
            children: [
              SvgPicture.string(
                '''<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="50.057" height="29" viewBox="0 0 50.057 29">
                    <g id="Group_6229" data-name="Group 6229" transform="translate(-1696.943 -1001.142)">
                      <g id="Group_6228" data-name="Group 6228" transform="translate(1663 870.998)">
                        <g id="Group_5772" data-name="Group 5772" transform="translate(55 130.142)">
                          <image id="Group_5324" data-name="Group 5324" width="29" height="29" transform="translate(0 0.001)" xlink:href="data:image/png;base64,"/>
                        </g>
                      </g>
                      <g id="Group_5671" data-name="Group 5671" transform="translate(1528.857 934.57)">
