                    fontSize: 13,
                    fontWeight: FontWeight.w500,
                  ),
                ),
              ),
            ],
          ),
        ),
      ),
    );
  }

  GlobalKey key = GlobalKey();
  Widget getWebMainWidget() {
    return MaterialApp(
      key: key,
      debugShowCheckedModeBanner: false,
      theme: ThemeData(
        primarySwatch: variables.kPrimaryColor,
      ),
      home: widget.child,
    );
  }
}
